export function SomeComponent(props) {
  const name = (props || {}).name || 'world'

  return (
    <div>
      <p>Hi, {name}!</p>

      <p>and some more things</p>
    </div>
  )
}

export function Local(props) {
  return <span style={{color: 'red'}} {...props} />
}

